import Navbar from "../components/Navbar";
import Hero from "../components/Hero";
import contactimg from "../assets/2.jpg";
import Footer from "../components/Footer";

function Products() {
  return (
    <>
      <Navbar />
      <Hero
        cname="hero-mid"
        heroimg={contactimg}
        title="Anything you need!"
        btnclass="hide"
      />
      <Footer />
    </>
  );
}

export default Products;
